import { Row, Carousel } from "antd";

const Dog = () => {
	return (
		<>
			<Row>
				<h1>hello dog!</h1>
			</Row>

			<Row>
				<Carousel></Carousel>
			</Row>
		</>
	);
};

export default Dog;
